import React, { Component } from 'react';
import './TabOptions.css';
//Importing componenents
import TabOption from './TabOption/TabOption';
//
export class TabOptions extends Component {

  constructor()
  {
      super();
      this.options = [
          {
              name: "Help",
              id: 1,
              foto: "https://www.swiggy.com/support",
          },
          // {
          //   name: "Offers",
          //   id: 2,
          // },
          {
            name: "Sign In",
            id: 3,
            foto:"https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.thestatesman.com%2Fwp-content%2Fuploads%2F2021%2F04%2Fswiggy-ians.jpg&imgrefurl=https%3A%2F%2Fwww.thestatesman.com%2Fbusiness%2F9500-orders-per-minute-received-swiggy-new-years-eve-1503035586.html&tbnid=4dsZ44GfqDHQlM&vet=12ahUKEwiMk4aFyMr2AhWAgGMGHV0VAZ8QMyhgegUIARCkAQ..i&docid=3W2JH0lWPG0gSM&w=1200&h=800&q=help%20logo%20in%20swiggy&ved=2ahUKEwiMk4aFyMr2AhWAgGMGHV0VAZ8QMyhgegUIARCkAQ",
          },
          {
            name: "Cart",
            id: 4,
            foto
          }];

  }  
  render() {
    return <div className='tab_options'>
        {this.options.map((option)=>
        {    
        return <TabOption key={option.id} details={option}/>
        })}
    </div>;
  }
}

export default TabOptions;
